import React from 'react';
import styled from 'styled-components';

const TodoTitlebox = styled.div`
  padding-top : 20 px;
  padding-bottom : 20 px;
  padding-left : 20 px;
  padding-right : 20 px;
  border-bottom: 1px solid black;

  h1 {
    margin : 0;
    font-size : 36px;
    color : #343a40;
  }

  .day {
    color : gray;
    font-size : 20px;
  }

  .ListCount {
    color: #20c997;
    font-size: 18px;
    margin-top: 40px;
    font-weight: bold;
  }
`;

function TodoTitle() {
  return (
    <TodoTitlebox>
      <h1>2022년 12월 25일</h1>
      <div className="day">금요일</div>
      <div className="Listcout">할 일 몇개 남음</div>
    </TodoTitlebox>
  )
}

export default TodoTitle;
